class WebBoardRegisterComponent extends Component{
    constructor(props){
        super(props);

    }

    render(){
        return (
            <>
            <div>Register Page</div>
            <div>
                <div>
                    <label>Title</label>
                    <input name="title"/>
                </div>
                <div>
                    <label>Content</label>
                    <textarea rows="3" name="content"></textarea>
                </div>
                <div>
                    <label>Writer</label>
                    <input name="writer"/>
                </div>
                <button>Submit Button</button>
                <button>Reset Button</button>
            </div>
            </>
        );
    }
}
export default WebBoardRegisterComponent
